const DOM = document.getElementById('box') // 获取DOM

const threeEditor = new ThreeEditor(DOM) // 使用ThreeEditor 简化 three.js 初始化场景系列操作

window.onresize = () => threeEditor.renderSceneResize() // 窗口大小变化

